import axios from "axios"

import {
    ADDRESS_REQUEST,
    ADDRESS_REQUEST_SUCCESS,
    ADDRESS_REQUEST_FAIL
} from "../types/AddressType"


export const getAddress = (firstAddress, secondAddress) => async (dispatch) => {

    dispatch({
        type: ADDRESS_REQUEST
    })
    try {const reqOne = axios.get("https://api.digitransit.fi/geocoding/v1/search?text=kamppi&size=1");
    const reqTwo = axios.get("https://api.digitransit.fi/geocoding/v1/search?text=Lapinlahdenkatu%2016&size=1");
        const { ...data } = await axios.all([reqOne, reqTwo])

        dispatch({
            type: ADDRESS_REQUEST_SUCCESS,
            payload: data
        })

    } catch (error) {
        dispatch({
            type: ADDRESS_REQUEST_FAIL,
            payload: error
        })
    }
}
